import { Grid } from "@material-ui/core";
import { CallMissedSharp } from "@material-ui/icons";
import { makeStyles } from "@material-ui/styles";
import React from "react";
import AppBar from "../../Components/App Bar/AppBar";
import "./UserMain.css";
import video from "../../assets/img/video.mp4";
import MovieIcon from '@material-ui/icons/Movie';
import AttachmentIcon from '@material-ui/icons/Attachment';

function MainAnalysis({ analysis }) {
  return (
    <Grid item xs={12} md={5} justify="center" alignItems="center">
      <div className="main__analysis">
        <div className="analysis__field">
          <Grid justify="center" alignItems="center" xs={6}>
            <h4 className="analysis__field--header">Grammar Accuracy: </h4>
            <span className="analysis__field--high">
              {"\u00A0"}
              {analysis.first}
            </span>
          </Grid>
